template<typename T> T exgcd(T a,T b,T &x,T &y) {
    if(!b) { x=1,y=0; return a; }
    T res=exgcd(b, a%b, x, y),t=x;
    x=y,y=t-(a/b)*y;
    return res;
}

int mvr9[]={0,1,1,3,-1,-1,3,1,1};
int mvc9[]={0,3,3,1,-3,-3,1,3,3};
int mvr10[]={0,1,3,3,-1,-3,-1,3,3,1};
int mvc10[]={0,3,-1,-1,3,1,3,-1,-1,3};

// n>=57
void solve(int n) {
    n--;
    LL a=8,b=9,x,y;
    exgcd(a, b, x, y);
    x*=n;
    y*=n;

    if(x<0) {
        LL t=(-x+b-1)/b;
        x+=b*t;
        y-=a*t;
    }
    if(y<0) {
        LL t=(-y+a-1)/a;
        y+=a*t;
        x-=b*t;
    }

    // assert(x>=0&&y>=0);
    // assert(a*x+b*y==n);
    // return;
    debug(x,y);
    int r=1,c=1;
    cout<<"POSSIBLE"<<endl;
    cout<<r<<' '<<c<<endl;
    while(x--) {
        for(int i=1;i<=8;i++) {
            r+=mvr9[i];
            c+=mvc9[i];
            cout<<r<<' '<<c<<endl;
        }
    }
    while(y--) {
        for(int i=1;i<=9;i++) {
            r+=mvr10[i];
            c+=mvc10[i];
            cout<<r<<' '<<c<<endl;
        }
    }
}

void solve() {
    int n;
    cin>>n;
    if(n<=56) {
        if(ans[n].empty()) cout<<"IMPOSSIBLE"<<endl;
        else {
            cout<<"POSSIBLE"<<endl;
            for(auto [x,y]:ans[n]) {
                cout<<x<<' '<<y<<endl;
            }
        }
    }
    else solve(n);
}

int main() {
    ios::sync_with_stdio(0);
    cin.tie(nullptr);
    solve();
    return 0;
}